import React from 'react';
import { LoginSignup } from '../components';
import { useRouter } from 'next/router';


const DynamicPage = () => {
	const router = useRouter();
	const { state } = router.query;
	if (id === 'login') {
		pageState = <Login />
	}
	if (id == 'register') {
		pageState = <Register />
	}
	return <div>{pageState}</div>
};

export default DynamicPage;
